import { Container } from 'react-bootstrap';

export default function Tentang() {
    return (
        <Container className="tentang-container">
            <h2 className="tentang-title">
                Tentang Kami
            </h2>
            <h3 className="tentang-subtitle">
                Selamat datang di Adlitech!
            </h3>
            <p className="tentang-text">
                Kami memiliki keahlian di industri teknologi dan berkomitmen untuk memberikan solusi inovatif. Dengan perhatian pada kepuasan pelanggan, kami siap menjadi mitra terpercaya Anda dalam mencapai tujuan teknologi.
            </p>
        </Container>
    );
}
